import React from "react";
import ImageGallery from "react-image-gallery";
import "react-image-gallery/styles/css/image-gallery.css";
import Images from "../assets/images/photo galary";

const images = [
  {
    original: {Images}+"1.jpeg",
    thumbnail: {Images}+"1.jpeg",
    description: "Image 1 description"
  },
  {
    original: {Images}+"s (2).jpeg",
    thumbnail: {Images}+"s (2).jpeg",
    description: "Image 2 description"
  },
  {
    original: {Images}+"s (3).jpeg",
    thumbnail: {Images}+"s (3).jpeg",
    description: "Image 3 description"
  },
  // ...add all 10–15 images here
];

export default function Gallery() {
  return (
    <div style={{ maxWidth: "900px", margin: "auto" }}>
      <ImageGallery
        items={images}
        autoPlay={true}
        slideInterval={3000}  // 3 seconds per image
        showThumbnails={true}
        showPlayButton={false}
        showFullscreenButton={true}
        showNav={true}
        infinite={true}
      />
    </div>
  );
}
